import React, { useState, useEffect, useMemo } from 'react';
import { useNavigate } from 'react-router-dom';
import API from '../services/api';

const STARTING_FLOAT = 150;

const CloseCajaPage = () => {
  const navigate = useNavigate();
  const storeId = localStorage.getItem('storeId');

  // Data fetching states
  const [salesData, setSalesData] = useState({ cash: 0, card: 0 });
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  // Form input states
  const [isCardCorrect, setCardCorrect] = useState(false);
  const [isCashCorrect, setCashCorrect] = useState(false);
  const [expenses, setExpenses] = useState([{ concept: '', description: '', price: '' }]);
  const [notes, setNotes] = useState('');

  useEffect(() => {
    const fetchTodaySales = async () => {
      setLoading(true);
      try {
        const todayStart = new Date();
        todayStart.setHours(0, 0, 0, 0);

        const response = await API.get('/api/sales', {
          params: {
            'filters[store][id][$eq]': storeId,
            'filters[Time][$gte]': todayStart.toISOString(),
          },
        });

        const todaySales = response.data?.data || [];
        const cashTotal = todaySales
          .filter(s => s.paymentmethod?.toLowerCase() === 'cash')
          .reduce((sum, s) => sum + (parseFloat(s.Price) || 0), 0);
        const cardTotal = todaySales
          .filter(s => s.paymentmethod?.toLowerCase() === 'card')
          .reduce((sum, s) => sum + (parseFloat(s.Price) || 0), 0);

        setSalesData({ cash: cashTotal, card: cardTotal });
      } catch (err) {
        setError('Failed to fetch sales data. Please try again.');
        console.error(err);
      } finally {
        setLoading(false);
      }
    };

    if (storeId) {
      fetchTodaySales();
    } else {
      setError('No store ID found. Please log in again.');
      setLoading(false);
    }
  }, [storeId]);

  const totalExpenses = useMemo(() => {
    return expenses.reduce((total, exp) => total + (parseFloat(exp.price) || 0), 0);
  }, [expenses]);

  const expectedCashInCaja = useMemo(() => {
    return salesData.cash + STARTING_FLOAT - totalExpenses;
  }, [salesData.cash, totalExpenses]);

  const handleAddExpense = () => {
    setExpenses([...expenses, { concept: '', description: '', price: '' }]);
  };

  const handleExpenseChange = (index, field, value) => {
    const newExpenses = [...expenses];
    newExpenses[index][field] = value;
    setExpenses(newExpenses);
  };

  const handleRemoveExpense = (index) => {
    const newExpenses = expenses.filter((_, i) => i !== index);
    setExpenses(newExpenses);
  }

  const handleFinishVerification = () => {
    const finalData = {
      storeId,
      closureDate: new Date().toISOString(),
      expectedCashSales: salesData.cash,
      expectedCardSales: salesData.card,
      isCardCorrect,
      startingFloat: STARTING_FLOAT,
      expenses,
      totalExpenses,
      expectedCashInCaja,
      isCashCorrect,
      notes,
    };

    // For now, we just log it. Later, this will send to the backend.
    console.log('--- Counter Closure Data ---');
    console.log(finalData);
    alert('Verification data has been logged to the console. Backend integration is pending.');
    navigate('/pos');
  };

  if (loading) return <div style={styles.container}><p>Loading daily sales data...</p></div>;
  if (error) return <div style={styles.container}><p style={{color: 'red'}}>{error}</p></div>;

  return (
    <div style={styles.container}>
      <header style={styles.header}>
        <h1>Close Counter for Store {storeId}</h1>
        <button onClick={() => navigate('/pos')} style={styles.backButton}>Back to POS</button>
      </header>

      <main style={styles.main}>
        {/* --- Sales Widget --- */}
        <section style={styles.widget}>
          <h2 style={styles.widgetTitle}>Total Sales</h2>
          <div style={styles.salesGrid}>
            <div style={styles.subWidget}>
              <h3>Total Cash Sales</h3>
              <p style={styles.bigNumber}>€{salesData.cash.toFixed(2)}</p>
            </div>
            <div style={styles.subWidget}>
              <h3>Total Card Sales</h3>
              <p style={styles.bigNumber}>€{salesData.card.toFixed(2)}</p>
              <div style={styles.checkboxContainer}>
                <input type="checkbox" id="card-correct" checked={isCardCorrect} onChange={(e) => setCardCorrect(e.target.checked)} />
                <label htmlFor="card-correct">Is this correct?</label>
              </div>
            </div>
          </div>
        </section>

        {/* --- Verification Widget --- */}
        <section style={styles.widget}>
          <h2 style={styles.widgetTitle}>Verification</h2>
          <div style={styles.subWidget}>
            <h3>Total Cash in Caja</h3>
            <div style={styles.calculation}>
              <span>Cash Sales: €{salesData.cash.toFixed(2)}</span>
              <span>- Expenses: €{totalExpenses.toFixed(2)}</span>
              <span>+ Starting Float: €{STARTING_FLOAT.toFixed(2)}</span>
              <hr style={styles.hr} />
              <strong style={styles.bigNumber}>= €{expectedCashInCaja.toFixed(2)}</strong>
            </div>
            <div style={styles.checkboxContainer}>
                <input type="checkbox" id="cash-correct" checked={isCashCorrect} onChange={(e) => setCashCorrect(e.target.checked)} />
                <label htmlFor="cash-correct">Is this the correct amount in the cash drawer?</label>
              </div>
          </div>
        </section>

        {/* --- Expenses Widget --- */}
        <section style={styles.widget}>
          <div style={{...styles.widgetTitleContainer, marginBottom: '20px'}}>
            <h2 style={styles.widgetTitle}>Expenses</h2>
            <button onClick={handleAddExpense} style={styles.addButton}>+ Add Expense</button>
          </div>
          <div style={styles.expenseHeader}>
            <div style={{flex: 2}}>Concept</div>
            <div style={{flex: 3}}>Description</div>
            <div style={{flex: 1, textAlign: 'right'}}>Price (€)</div>
            <div style={{width: '40px'}}></div>
          </div>
          {expenses.map((exp, index) => (
            <div key={index} style={styles.expenseRow}>
              <input type="text" placeholder="e.g., Water Bottle" value={exp.concept} onChange={e => handleExpenseChange(index, 'concept', e.target.value)} style={{...styles.input, flex: 2}} />
              <input type="text" placeholder="Details about the expense" value={exp.description} onChange={e => handleExpenseChange(index, 'description', e.target.value)} style={{...styles.input, flex: 3}} />
              <input type="number" placeholder="0.00" value={exp.price} onChange={e => handleExpenseChange(index, 'price', e.target.value)} style={{...styles.input, flex: 1, textAlign: 'right'}}/>
              <button onClick={() => handleRemoveExpense(index)} style={styles.removeButton}>×</button>
            </div>
          ))}
        </section>

        {/* --- Notes Widget --- */}
        <section style={styles.widget}>
          <h2 style={styles.widgetTitle}>Notes</h2>
          <textarea value={notes} onChange={e => setNotes(e.target.value)} style={styles.textarea} placeholder="Add any relevant notes for the day..."></textarea>
        </section>

        <footer style={styles.footer}>
          <button onClick={handleFinishVerification} style={styles.finishButton}>Finish Verification</button>
        </footer>
      </main>
    </div>
  );
};

const styles = {
  container: { padding: '32px', maxWidth: '1200px', margin: '0 auto', fontFamily: 'system-ui', backgroundColor: '#f9fafb' },
  header: { display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '32px', borderBottom: '1px solid #e5e7eb', paddingBottom: '16px' },
  backButton: { padding: '10px 16px', border: '1px solid #d1d5db', borderRadius: '6px', cursor: 'pointer' },
  main: { display: 'flex', flexDirection: 'column', gap: '32px' },
  widget: { backgroundColor: 'white', padding: '24px', borderRadius: '8px', border: '1px solid #e5e7eb', boxShadow: '0 1px 3px rgba(0,0,0,0.05)' },
  widgetTitleContainer: { display: 'flex', justifyContent: 'space-between', alignItems: 'center' },
  widgetTitle: { fontSize: '18px', fontWeight: '600', color: '#111827', margin: 0 },
  salesGrid: { display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '24px', marginTop: '16px' },
  subWidget: { padding: '20px', backgroundColor: '#f9fafb', borderRadius: '6px', border: '1px solid #e5e7eb' },
  bigNumber: { fontSize: '28px', fontWeight: '700', color: '#1f2937', margin: '8px 0' },
  checkboxContainer: { marginTop: '16px', display: 'flex', alignItems: 'center', gap: '8px' },
  calculation: { display: 'flex', flexDirection: 'column', gap: '8px', marginTop: '16px', fontSize: '14px' },
  hr: { border: 'none', borderTop: '1px solid #d1d5db', margin: '8px 0' },
  addButton: { padding: '8px 12px', border: 'none', borderRadius: '6px', backgroundColor: '#3b82f6', color: 'white', cursor: 'pointer', fontWeight: 500 },
  expenseHeader: { display: 'flex', gap: '16px', fontWeight: 600, color: '#4b5563', paddingBottom: '8px', borderBottom: '1px solid #e5e7eb', marginBottom: '8px', fontSize: '14px' },
  expenseRow: { display: 'flex', gap: '16px', alignItems: 'center', marginBottom: '8px' },
  input: { padding: '8px 12px', border: '1px solid #d1d5db', borderRadius: '6px' },
  removeButton: { width: '32px', height: '32px', border: '1px solid #d1d5db', borderRadius: '50%', backgroundColor: 'white', cursor: 'pointer', color: '#ef4444', fontSize: '16px' },
  textarea: { width: '100%', minHeight: '100px', padding: '8px 12px', border: '1px solid #d1d5db', borderRadius: '6px', marginTop: '16px' },
  footer: { display: 'flex', justifyContent: 'flex-end', marginTop: '16px' },
  finishButton: { padding: '12px 24px', border: 'none', borderRadius: '6px', backgroundColor: '#16a34a', color: 'white', cursor: 'pointer', fontWeight: 600, fontSize: '16px' },
};

export default CloseCajaPage;
